import styled from "styled-components";
import ShareLine from "./ShareLine";


const Container = styled.div`
    font-family: WantedSans-Regular;
    margin-top : 40px;
    font-size : 16px;
    padding : 5px;
`

const TextContainer = styled.div`
    color : white;

`


function About() {

    return (
        <Container>
            <ShareLine />
            <TextContainer>
                <p >안녕하세요 코드 첨삭을 즐기는 개발자 김제주 ( 김건휘 ) 입니다.</p>
                <p >주로 서버개발 및 인프라 구축, 운영 배포 쪽의 업무를 맡고 있습니다. </p>
                <p >저는 작성한 코드를 첨삭하는 과정에서 더 나은 가독성 및 <br /> 생산성을 확보하는 작업을 즐기며 개발을 하고 있습니다!</p>
                <p >저에 대해 궁금하시다면 언제든 연락주세요 ! </p>
            </TextContainer>
        </Container>
    )
}

export default About
